  const team = new Team({
      _id: new mongoose.Types.ObjectId(),
      name: String,
      championship: String
    },
    {
      timestamps: {
        createdAt: new Date()
      }
    });
  return team.save(function (err) {
    if (err) return console.log(err);
    console.log("Successfully saved " + team);
  });
}

export function updateteam(data) {
  return Team.updateOne({_id: data._id}, {$set: data})
}

